import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Banner from "./components/Banner";
import Home from "./pages/Home";

function App() {
  const routes = [
    {
      path: "/",
      level: "all",
      title: "Employees",
    },

    {
      path: "/executives",
      level: "executives",
      title: "Executives",
    },

    {
      path: "/mids",
      level: "mids",
      title: "Mid Managements",
    },

    {
      path: "/juniors",
      level: "juniors",
      title: "Juniors",
    },
  ];

  return (
    <BrowserRouter>
      <Routes>
        <Route
          path="/"
          element={
            <Banner title={"Employee"}>
              <Home />
            </Banner>
          }
        />
        <Route
          path="/executives"
          element={
            <Banner title={"Executives"}>
              <Home level={"executives"} />
            </Banner>
          }
        />
        <Route
          path="/mids"
          element={
            <Banner title={"Mid Management"}>
              <Home />
            </Banner>
          }
        />
        <Route
          path="/juniors"
          element={
            <Banner title={"Juniors"}>
              <Home />
            </Banner>
          }
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
